import React from 'react';
import './App.css';
import { Switch, Route } from 'react-router-dom'
import Homepage from './pages/homepage/homepage.component';

function App() {

  const HatsPage = () => (
    <div>
      <h1>Hats Page</h1>
    </div>
  )

  return (
    <div>
      <Switch>
      <Route exact path = '/'>
        <Homepage/>
      </Route>
      <Route path= '/hats' component={HatsPage}>
        <HatsPage/>
      </Route>
      </Switch> 
    </div>

  );
}

export default App;
